import React, {useContext, useState} from 'react';
import io from "socket.io-client"
import ReactDOM from 'react-dom/client';
import App from './components/app/app';
import {Route, BrowserRouter, Routes, Navigate} from "react-router-dom"

let ClientID;
const Client = io("http://localhost:5000")
Client.on("socket-id", ({ID}) => {
  ClientID = ID
})
export const MainContext = React.createContext()
const root = ReactDOM.createRoot(document.getElementById('root'))
const Reset_root = () => {
   const {setPassReset} = useContext(MainContext)
   setPassReset(true)
   return (
     <div></div>
   )
}
const Main_root = () => {
  const [passReset, setPassReset] = useState(false)
  return (
    <MainContext.Provider value={{
      passReset: passReset,
      setPassReset: setPassReset
    }}>
      <BrowserRouter>
        <Routes>
            <Route path="/" element={<div></div>}>
                <Route index element={<App></App>}></Route>
                <Route exact path="/resetPassword" element={<Reset_root></Reset_root>}></Route>
            </Route>
        </Routes>
      </BrowserRouter>
    </MainContext.Provider>
  )
}
root.render(
  <React.StrictMode>
      <Main_root />
  </React.StrictMode>
)
export default {Client: Client, CID: ClientID};
